import "../boostrap/boostrap.css";
import "../../node_modules/bootstrap/dist/js/bootstrap.bundle";
import "./css/Gallery.css";

const Gallery = () => {
  return (
    <>
      <h1 className="gl_h1">My Gallery</h1>
      <ul>
        <li>
          <div>
            <h2> Event Bornto Protect </h2>
            <p></p>
          </div>
        </li>
      </ul>
    </>
  );
};

export default Gallery;
